import React from 'react';
import SinglePost from '../SinglePost/index.jsx';
import { postsData } from '../postsData.js';

export default function PostContainer() {
    return (
        <div>
            {
                postsData.map(post => <SinglePost key={post.id} postData={post} />)
            }
        </div>
    );
}
